webpackJsonp([0xf0d29a679a68],{7241:function(t,e){t.exports={data:{post:{html:'<p>Funny, ever since I went to work for a blogging company, I don\'t really have time to pay attention to my own blog. But I did some tweaking today. I put in new <a href="http://www.twin-music.com/azlyrics/g_file/songs/gogo/head.html">song lyrics</a> in the header, and put back the  <a title="PapaScott: Heros without Glory" href="http://www.papascott.de/archives/2003/06/18/heros-without-glory/">photo of the DDR uprising girl</a>. And I adjusted the blogroll to show only a random category instead of the whole thing, plus the expat weblogs (since that\'s probably the most unique group I belong to). Randomizing the blogroll will probably mess with <a href="http://www.technorati.com/">Technorati\'s</a> mind when counting my outgoing links, though. We\'ll see.</p>',fields:{title:"Dusting The Bookends",date:"19 Feb 2005",url:"https://papascott.de/2005-02-19-dusting-the-bookends/"}}},pathContext:{slug:"/2005-02-19-dusting-the-bookends/",prev:{fields:{title:"Homework",date:"17 Feb 2005",slug:"/2005-02-17-homework/"}},next:{fields:{title:"Schleswig-Holstein Votes",date:"20 Feb 2005",slug:"/2005-02-20-schleswigholstein-votes/"}}}}}});
